import axios from 'axios'
import { URL } from '../constants/urls'

const getAll = async () => {
    const weatherHistory = (await axios.get(URL.WEATHERHISTORY))
    return weatherHistory.data
}

const create = async (newObject: string) => {
    const newCity = await axios.post(URL.WEATHERHISTORY, newObject)
    console.log(newCity.data)
    return newCity.data
}

const remove = () => {
    return axios.delete(URL.WEATHERHISTORY)
}

export default { getAll, create, remove }
